1.5oz Cognac Il de Ré @camuscognac 
0.5oz Maraschino Liqueur @luxardo
0.5oz Amaro Abano @luxardoofficial 
0.75oz Lime Juice
4 green walnuts with syrup from jam
6 drops Natural Foaming Agent @foamee.me 
.
🎪
Shake well to get that nice foam on top and get most of the flavors from the green walnuts. Strain and serve with a couple of green walnuts
.
🎪
I saw a recent recipe on @theeducatedbarfly YouTube channel, an endless source of inspiration if you don’t know what to sip. The Breakfast Martini involves orange marmalade, and I remembered that I have some awesome jam jars in the fridge that I neglected 
.
🎪
This certainly doesn’t have anything to do with that recipe, but you should certainly try to do something you love with marmalade, jam, sherbet, sorbet or ice cream. These carry amazing flavors that you might not find in another shape or form
.
🎪

